//reality is what it is regardless of what we think it is... or is it?// this piece of intermedia work is created bringing the analog and the digital together in sight and sound. 

this artwork was created for the "Indigo — The Seventh Color" curated exhibition by NFT Factory in Paris, France // originally meant to be minted on the custom contract created for the show but the Ethereum gas fees and my personal economics got in the way

espinosa — 2023
